import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup } from '@angular/forms';
import { TicketService } from '../../../services/ticket/ticket.service';
import { Major, Ticket } from '../../../models/ticket';
import { StudentService } from 'src/services/student/student.service';
import { Student } from 'src/models/student';

@Component({
  selector: 'app-ticket-form',
  templateUrl: './ticket-form.component.html',
  styleUrls: ['./ticket-form.component.css']
})
export class TicketFormComponent implements OnInit {

  // Note: We are using here ReactiveForms to create our form. Be careful when you look for some documentation to
  // avoid TemplateDrivenForm (another type of form)
  /**
   * TicketForm: Object which manages the form in our component.
   * More information about Reactive Forms: https://angular.io/guide/reactive-forms
   */
  public ticketForm: FormGroup;
  public MajorList: String[] = Object.values(Major);
  public Student_List: Student[] = [];

  constructor(public formBuilder: FormBuilder, public ticketService: TicketService, public studentService: StudentService) {
    // Form creation
    this.ticketForm = this.formBuilder.group({
      title: [''],
      description: [''],
      major: [''],
      studentID: ['']
    });
    // console.log(this.Student_List);
    // Observable
    this.studentService.students$.subscribe((students) => this.Student_List = students);

    // You can also add validators to your inputs such as required, maxlength or even create your own validator!
    // More information: https://angular.io/guide/reactive-forms#simple-form-validation
    // Advanced validation: https://angular.io/guide/form-validation#reactive-form-validation
  }

  ngOnInit() {
    console.log('Liste of St : ', this.Student_List);
  }

  addTicket() {
    const ticketToCreate: Ticket = this.ticketForm.getRawValue() as Ticket;
    ticketToCreate.date = new Date();
    ticketToCreate.archived = false;
    const studentID = this.ticketForm.get('studentID')!.value;
    console.log('studentID:', studentID);
    console.log('Student_List:', this.Student_List);

    ticketToCreate.student = this.Student_List.find(student => student.id === studentID);

    ticketToCreate.student = this.Student_List.find(student => student.id === this.ticketForm.get('studentID')!.value);
    // if (ticketToCreate.studentID) {
    //   const foundStudent = this.Student_List.find(student => student.id === ticketToCreate.studentID);
    //   if (foundStudent) {
    //     ticketToCreate.student = foundStudent;
    //     this.ticketService.addTicket(ticketToCreate);
    //   } else {
    //     // Gérer le cas où l'étudiant n'a pas été trouvé
    //     console.log("Étudiant non trouvé");
    //   }
    // } else {
    //   // Gérer le cas où l'étudiant n'est pas défini
    //   console.log("Étudiant non défini");
    // }
    this.ticketService.addTicket(ticketToCreate);
  }

}
